function carSense = turnLanesB()% This is a function which will read the Hall Effect sensors% to sense if a car is present at the turn lane.% Inputs: None% Local Outputs: None% Global outputs: [TLAseq, TLCseq] global TLAseq % Declare TurnLane Variables as global. global TLCseqt = gtime();[Error carTLA] = digitalRead(11); % If digitalRead is 1, sets carTLA to 0, and vice versa.[Error carTLC] = digitalRead(12);carSense = [carTLA, carTLC]; %Output for diagnostics.if t < 0.2  if carTLC == 0 % Read Hall Effect Sensor to see if car waiting(activates at zero).  TLCseq = 1;  endelseif 41.8 < t && t < 42 % Read at TLA sensor.  if carTLA == 0  TLAseq = 1;  endelseif t > 59.8 && t < 60  if carTLC == 0  TLCseq = 1;  endendend